import React from 'react';

class Footer extends React.Component {
    render() {
        return (
            <div className="footer">
                <p>Please join us for our wedding celebration,
                    August 4th 2022</p>
                <p className="photocredit">Photo Credit: Brittany Fleming - Facebook: @bflemingphoto Instagram: @bflemingphotography</p>
            </div>
        )
    }
}

export default Footer;
